import React from 'react';
import './card.style.css'

export const Card = (props) => (
    <div className='card-container'> 
    <img id={props.house.id} 
    src={require("/Users/karenhernandeze/Desktop/WRSP-FB/web_page/src/components/card/images/${id}$.jpg")}
    width='180'
    height='180'
    alt="Houses"
    />
    <h1> {props.house.name} </h1>
    </div>
)
